import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FormBar = ({ name, label, icon }) => {
  return (
    <a>
      <span>{name}</span>
      <span className="download">
        {label}
        <FontAwesomeIcon icon={icon} />
      </span>
    </a>
  );
};

export default FormBar;
